Most requirements are covered by the function descriptions below. The expected format for printing dice is: A B C D E
+-+ +-+ +-+ +-+ +-+
|1| |5| |3| |3| |6|
+-+ +-+ +-+ +-+ +-+ There must be no trailing whitespace on these lines, and it must end with a line break (println, not print). If you use a loop to print the die values, then you can include an if statement in the loop to control whether a space is printed after the last part: loop (...) { // print the die and vertical lines IO.print(...); // only print a space if we're not on the last index of the array if (index < array.length - 1) { IO.print(" "); }
}
// end the middle line
IO.println();
